DROP TABLE IF EXISTS Historique CASCADE;
DROP TABLE IF EXISTS Profil CASCADE;
DROP TABLE IF EXISTS Mots CASCADE;


CREATE TABLE Historique(
	id_partie int check (id_partie >0) DEFAULT 0 NOT NULL,
	type varchar check (type in ('survie','daily','libre')) NOT NULL,
	id int check (id > 0) NOT NULL,
	paterne varchar,
	mot_a_deviner varchar NOT NULL,
	primary key(id_partie,id,type));


CREATE TABLE Profil(
	id int primary key check (id > 0) NOT NULL,
	pseudo varchar check (length(pseudo) >= 4),
	mail varchar check (mail LIKE '%@%') default '@',
	numTel varchar check (length(numTel) = 10 or length(numTel) = 14 ) default '00 00 00 00 00',
	mdp varchar check (length(mdp) >= 4) default 'tncy',
	nb_partie_jouees int check(nb_partie_jouees >=0),
	xp int check (xp >= 0) DEFAULT 0,
	niveau int check (niveau > 0) DEFAULT 1,
	date_dernier_essai varchar check (date_dernier_essai LIKE '__/__/____') DEFAULT current_date);


CREATE TABLE Mots(
	mot varchar primary key check (4 < length(mot) < 11) NOT NULL,
	len_mot int check (4 < len_mot < 11));
	
	
